 We can use React Context to create a global state for the Tooltip component.

## Create a Tooltip in NextJS using React Context

### Create a Tooltip component

First, we need to create a Tooltip component. This component will be used in different places but don't have a scope context and are therefore isolated from itself. We can use React Context to create a global state for the Tooltip component.
```
import React, { useState } from "react";

const TooltipContext = React.createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => {
  const { tooltip, setTooltip } = React.useContext(TooltipContext);

  return { tooltip, setTooltip };
};
```
